import React from "react";
import "./Rules.css";

function Home() {
  return (
    <div style={{ padding: "20px" }}>
      <h1>Kumla Sportfiske</h1>
      <div className="rules-container text-break" style={{ display: "flex", gap: "20px", flexWrap: "wrap" }}>
        
        {/* Vänster kolumn – text om klubben */}
        <div style={{ flex: 1, minWidth: "300px" }}>
          <p>
            Välkomna till Kumla Sportfiskeförening och Säbylundssjön! <br></br> 
            Säbylundssjön är en lättillgänglig familjesjö. Spinn, mete, pimpel och flugfiske är tillåtet. Säbylundssjön är ett gammalt sandtag och har mycket bra vattenkvalitet och ett rikt insektsliv. 
            
          </p>
        </div>

        {/* Höger kolumn – Facebook */}
        <div style={{ flex: 1, minWidth: "300px" }}>
          <div
            className="fb-page"
            data-href="https://www.facebook.com/KumlaSportfiske/"
            data-tabs="timeline"
            data-width="340"
            data-height=""
            data-small-header="false"
            data-adapt-container-width="true"
            data-hide-cover="false"
            data-show-facepile="true">
          </div>
        </div>
      </div>
    </div>
  );
}

export default Home;
